import React, { Component } from 'react';
/*import logo from './logo.svg';
//import './App.css'; */
import Empl from  './components/employee_details'
import { Navbar, NavbarBrand, Nav, NavItem, NavLink} from "reactstrap";
class App extends Component {
    constructor(props){
        super(props)
        this.state = {
            activeTab : 1
        }
    }
  render() {
    return (
        <div>
            <div>
                <Navbar className= "bg-faded">
                    <NavbarBrand href = "/" className= "align-content-between">Powerpay</NavbarBrand>
                    <Nav className="m1" tabs>
                        <NavItem>
                            <NavLink> Registration </NavLink>
                        </NavItem>
                        <NavItem>
                            <NavLink> Preview </NavLink>
                        </NavItem>
                        <NavItem>
                            <NavLink> Employee Details </NavLink>
                        </NavItem>
                    </Nav>
                </Navbar>
            </div>
          </div>
    );
  }
}

export default App;
